import React from 'react';
import './App.css';
import Design from './components/design';
import NavBar from './components/navigation/nav_bar';
class App extends React.Component {
  render () {
    return(
    <div className="App">
    <div className='particles'>
    <Design/>
    <NavBar />
    </div>
    <h1 className='white f1 mt5'>Hi, my name is Regi Loshi <br/>I'm a  Software Engineering Student.</h1>
    </div>
    )
  }
}

export default App;
